import React from 'react';
import { useVessel } from '../context/VesselContext'; // Ajustez le chemin si nécessaire

const Operations = () => {
  const { vessels } = useVessel();

  return (
    <div>
      <h2>Operations</h2>
      {vessels.length > 0 ? (
        <ul>
          {vessels.map((vessel) => (
            <li key={vessel.imoNumber}>
              {vessel.vesselName} - {vessel.vesselType}
            </li>
          ))}
        </ul>
      ) : (
        <p>No vessels added yet.</p>
      )}
      {/* Ajoutez ici le reste du contenu pour le module Operations */}
    </div>
  );
};

export default Operations;
